from typing import Dict, Any

def merge_dicts(*dicts: Dict[str, Any]) -> Dict[str, Any]:
    """
    Merge multiple dictionaries into a single dictionary.

    Later dictionaries override earlier ones when keys conflict.
    None values are gracefully skipped.

    Args:
        *dicts: Variable number of dictionaries to merge. None values are ignored.

    Returns:
        A single merged dictionary containing all key-value pairs.

    Raises:
        TypeError: If any non-None argument is not a dictionary.

    Examples:
        >>> merge_dicts({"a": 1}, {"b": 2})
        {'a': 1, 'b': 2}
        >>> merge_dicts({"a": 1}, {"a": 2})
        {'a': 2}
        >>> merge_dicts({"a": 1}, None, {"b": 2})
        {'a': 1, 'b': 2}
    """
    result: Dict[str, Any] = {}

    for i, d in enumerate(dicts):
        # Handle None gracefully
        if d is None:
            continue

        # Validate that argument is a dictionary
        if not isinstance(d, dict):
            raise TypeError(
                f"Argument {i}: expected dict, got {type(d).__name__}. "
                f"Value: {repr(d)[:50]}"
            )

        # Merge the dictionary
        try:
            result.update(d)
        except Exception as e:
            raise TypeError(
                f"Failed to merge dictionary at position {i}: {str(e)}"
            )

    return result


