if __name__ == "__main__":
    # Basic merging
    assert merge_dicts({"a": 1}, {"b": 2}) == {"a": 1, "b": 2}
    print("✓ Basic merge")

    # Override behavior
    assert merge_dicts({"a": 1}, {"a": 2}) == {"a": 2}
    print("✓ Key override")

    # Empty arguments
    assert merge_dicts() == {}
    print("✓ Empty arguments")

    # Single dictionary
    assert merge_dicts({"a": 1}) == {"a": 1}
    print("✓ Single dict")

    # None handling
    assert merge_dicts({"a": 1}, None, {"b": 2}) == {"a": 1, "b": 2}
    print("✓ None in middle")

    # Multiple Nones
    assert merge_dicts(None, {"a": 1}, None, {"b": 2}, None) == {"a": 1, "b": 2}
    print("✓ Multiple Nones")

    # All None values
    assert merge_dicts(None, None, None) == {}
    print("✓ All Nones")

    # Complex nested values
    result = merge_dicts(
        {"a": [1, 2]},
        {"b": {"x": 10}},
        {"c": (1, 2, 3)}
    )
    assert result == {"a": [1, 2], "b": {"x": 10}, "c": (1, 2, 3)}
    print("✓ Complex values")

    # Deep override
    assert merge_dicts(
        {"a": {"x": 1, "y": 2}},
        {"a": {"x": 10}}
    ) == {"a": {"x": 10}}
    print("✓ Deep override")

    # Error: invalid type - string
    try:
        merge_dicts({"a": 1}, "invalid")
        assert False
    except TypeError as e:
        assert "expected dict" in str(e).lower()
        print("✓ TypeError for string")

    # Error: invalid type - list
    try:
        merge_dicts({"a": 1}, [1, 2, 3])
        assert False
    except TypeError as e:
        assert "expected dict" in str(e).lower()
        print("✓ TypeError for list")

    # Error: invalid type - integer
    try:
        merge_dicts({"a": 1}, 42)
        assert False
    except TypeError as e:
        assert "expected dict" in str(e).lower()
        print("✓ TypeError for int")

    # Empty dictionaries
    assert merge_dicts({}, {}, {}) == {}
    print("✓ Empty dicts")

    # Mixed empty and populated
    assert merge_dicts({}, {"a": 1}, {}) == {"a": 1}
    print("✓ Mixed empty/populated")

    # Three-way merge
    assert merge_dicts({"a": 1}, {"b": 2}, {"c": 3}) == {"a": 1, "b": 2, "c": 3}
    print("✓ Three-way merge")

    # Complex override chain
    result = merge_dicts(
        {"a": 1, "b": 2, "c": 3},
        {"b": 20, "d": 4},
        {"c": 30, "e": 5},
        {"a": 100}
    )
    assert result == {"a": 100, "b": 20, "c": 30, "d": 4, "e": 5}
    print("✓ Complex override chain")

